pragma solidity ^0.5.0;

import 'openzeppelin-solidity/contracts/token/ERC20/ERC20.sol';

contract Token2 is ERC20 {
  // The keyword "public" makes variables
  // accessible from other contracts
  // 1.   
  address public minter; //    
  string public corporation; //   
  string public name; //  
  string public symbol; // 
  uint public decimals; //   
  uint public initialSupply; //  

  struct Holders {
    // string holdersName; // 
    string id; //  +   
    uint stockAmount;  //  
  }

  mapping(address => Holders) public certHolders; //    .

    // Events allow clients to react to specific
    // contract changes you declare
    // 2.  
    //      ,   ,   
    event Sent(address indexed from, address indexed to, uint amount);


 constructor() public {
    minter = msg.sender;
  }

  function publish(string memory _corporation, string memory _name, string memory _symbol, uint _decimals, uint _initialSupply) public {
    require(minter == msg.sender);
require(initialSupply < 1e60);
    corporation = _corporation;
    name = _name;
    symbol = _symbol;
    decimals = _decimals;
    initialSupply = _initialSupply;

    _mint(minter, initialSupply);
  }

    // 
    function mint(uint _additionalSupply) public {
        require(minter == msg.sender);
      _mint(minter, _additionalSupply);
    }
}
